// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";

const Navbar = ({ isAuthenticated }) => {
  return (
    <nav className="bg-gray-800 text-white p-4 fixed w-full top-0 left-0 z-50">
      <div className="flex justify-between items-center">
        <div className="text-2xl font-bold">Job Portal</div>
        <div className="space-x-4">
          <Link to="/" className="hover:bg-gray-700 p-2 rounded">Jobs</Link>
          {isAuthenticated ? (
            <>
              <Link to="/profile" className="hover:bg-gray-700 p-2 rounded">Profile</Link>
            </>
          ) : (
            <>
              <Link to="/signup" className="hover:bg-gray-700 p-2 rounded">Sign Up</Link>
              <Link to="/login" className="hover:bg-gray-700 p-2 rounded">Login</Link>
            </>
          )}
          <Link to="/contact" className="hover:bg-gray-700 p-2 rounded">Contact Us</Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
